import React, { useState } from "react";
import "./Css/restaurentDetailsCss.css"; // Make sure to import your CSS file

function RestaurentMainDetail() {
  return (
    <div className="sectionRestaurant sectionRestaurant-product ">
      <div className="image-container">
        <img src={process.env.PUBLIC_URL + "/images/pizza-1.jpg"} />
      </div>
      <div className="sectionRestaurant-product-content">
        <h1>Restaurent Name</h1>
        <p>
          <strong>Popular dishes :</strong> Chicken Parmesan. crushed tomato
          aged provolone mozzarella parmesan rigatoni. Chicken Pesto. sweet
          basil shaved garlic toasted pine nut crispy caper gigli.
        </p>
      </div>
    </div>
  );
}

export default RestaurentMainDetail;
